import React from "react";

const Header = () => {

  let companyName = "DNT";
  const companyAddress = <h4>BKK</h4>;
  let num = 10;

  const showMessage = () => {
    return companyName + ".com";
  };

  const isLogin = true;

  return (
    <div>
      <h1>บริษัท {companyName}</h1>
      {companyAddress}
      {showMessage()}
      { isLogin === true && <p>Welcome</p> }
      <br />
      {num + 50}
    </div>
  );
};

export default Header;
